}

    left: 0px !important;

    opacity: .5 !important;
}

}

.iw-mSelected {
    background-color: #F6F6F6 !important;
}

}

.iw-cm-arrow-right {

    position: absolute !important;
    right: 5px !important;
    top: 50% !important;
    margin-top: -5px !important;
}

.dark-mode .iw-cm-arrow-right, .TnITTtw-dark-mode .iw-cm-arrow-right {
    border-left-color: #FFF !important;
}

}
